def copy_dummy(bit, index_bit):
    if index_bit <= swtich_to_1024:
        if bit == '1':
            new_obj = src_obj_1.copy()
        else:
            new_obj = src_obj_0.copy()
    else:
        new_obj = src_obj_1024.copy()
    new_collection.objects.link(new_obj)
    return new_obj

def copy_dummy_hex(hex, index_bit):
    new_obj_hex = src_obj_hex.copy()
    new_obj_hex.data.body = hex
    new_collection.objects.link(new_obj_hex)
    return new_obj_hex




def bake():
    print ('baking...')

    bpy.ops.object.select_all(action='DESELECT')

    for obj in bpy.data.objects:
        if '_b' in obj.name:
            obj.data = obj.data.copy()
            obj.select_set(True)

    for obj in bpy.data.objects:
        if '_b' in obj.name:
            bpy.context.view_layer.objects.active = obj
            bpy.ops.object.join()
            return


def add_driver(
        source, target, prop, dataPath,
        index = -1, negative = False, func = ''
    ):
    ''' Add driver to source prop (at index), driven by target dataPath '''

    if index != -1:
        d = source.driver_add( prop, index ).driver
    else:
        d = source.driver_add( prop ).driver

    v = d.variables.new()
    v.name                 = prop
    v.targets[0].id        = target
    v.targets[0].data_path = dataPath

    d.expression = func + "(" + v.name + ")" if func else v.name
    d.expression = d.expression if not negative else "-1 * " + d.expression


def remove_instances():
    print ('deleting...')
    for obj in bpy.data.objects:
        if ('_b' in obj.name) or ('_h' in obj.name):
            bpy.data.objects.remove(obj , do_unlink = True)


def create_collection(input_name):
    for col in bpy.data.collections:
        if col.name == input_name:
            return col

    new_collection = bpy.data.collections.new(name=input_name)
    bpy.context.scene.collection.children.link(new_collection)
    return new_collection











